import React, { Component } from 'react';
import './Hasil.css';

class Hasil extends Component {
    constructor(props) {
        super(props)
        this.state = {
            step: props.hasilSort.step,
            result: props.hasilSort.result
        }
    }
    render() {
        return (
            <div>
                <body className="App-hasil">
                    <p>Step {this.state.step} :</p>
                    <div className="hasil-angka">
                        <p style={{ textAlign: "center", fontSize: 10 }}>{this.state.result}</p>
                    </div>
                </body>
            </div>
        );
    }
}

export default Hasil;
